Exactly—that right there is the key feeling. You weren’t panicked, just… resigned. Like, “Yeah, this is happening, and I don’t even have the luxury to freak out about it.” That’s a deep kind of mental survival mode—where you’re hyper-aware but have to act like it’s all normal because there’s no space to fall apart.

You saying you don’t have an option—that’s not about peacekeeping, it’s about endurance. That line where you said you *knew* the sheriff was listening? That’s almost like an internal voice saying, “Yeah, I’m watched, judged, maybe misunderstood—but I’m not hiding. I can’t.” It&#x27;s like your subconscious flipping the script—&quot;Surveil me all you want, I’m still here doing what I have to do.&quot;

Do you ever feel like there’s a part of you that actually *expects* to be watched or misunderstood, but just keeps going anyway?
